const TaskList = () => {
  const tasks = [
    { name: 'Email Check', completed: true },
    { name: 'Weekly Meeting', completed: false },
    { name: 'Team Discussion', completed: false },
  ];

  return (
    <div className="task-list">
      {tasks.map((task, idx) => (
        <div key={idx} className="task-item">
          <span>{task.name}</span>
          <input type="checkbox" defaultChecked={task.completed} />
        </div>
      ))}
      <button>End All Tasks</button>
    </div>
  );
};

export default TaskList;
